import React from 'react';

function Dashboard() {
  return (
    <div className="text-center py-10">
      <h1 style={{ fontSize: '2.25rem', fontWeight: 'bold', color: '#1F2937', marginBottom: '1rem' }}>ERP Dashboard</h1>
      <p style={{ fontSize: '1.125rem', color: '#4B5563' }}>Chào mừng đến với hệ thống ERP đơn giản!</p>
      <p style={{ color: '#6B7280', marginTop: '0.5rem' }}>Sử dụng menu để xem danh sách sản phẩm và người dùng.</p>
    </div>
  );
}

export default Dashboard;
